INSERT INTO `md_columns` (`md_columns_id`, `tenant_id`, `md_columns_name`, `md_columns_type`, `md_columns_length`, `md_dec_length`, `is_cols_null`, `md_columns_desc`, `is_key`, `public_flag`, `active_flag`, `md_tables_id`, `create_by`, `create_date`, `last_update_by`, `last_update_date`) VALUES ('1398550847767076870', '3', 'STATUS', 'INT', NULL, NULL, 'Y', '定义场景一：Spart行（服务）\r\n1.Draft：方案配置中心交付配置及RAS/TMS金额调整数据生成合同履行行时的初始状态。\r\n2.Waiting for trigger：\r\n正向行预匹配到收入拆分金额后的状态。\r\n负向行、调整行无此状态。\r\n3.Triggered：收入首次触发后，根据DU+产品COA匹配合同履行行后的状态，履行行匹配收入拆分数据（RAS/TMS同步金额锁定）后也是这个状态。\r\n4.Closed：\r\n当DU+COA或COA触发比为100%时的状态。\r\nTriggered或Reopened状态可转换为Closed状态。\r\n5.Reopened：当触发进度达到100%后，进行收入反冲，履行行状态重新打开。\r\n6.Cancelled：正向行数量减为0时的状态。\r\n\r\n定义场景二：台套行（设备）\r\n21.Draft：方案配置中心清晰配置发布时的初始状态。\r\n22.Published：方案配置中心交付配置发布状态。\r\n2.Waiting for trigger：同上\r\n3.Triggered：同上\r\n4.Closed：同上\r\n6.Cancelled：同上\r\n', 'N', 'Y', 'Y', '1398550847511224320', '1004', '2021-05-29 16:04:40', '1004', '2021-05-29 16:04:40');
INSERT INTO `md_columns` (`md_columns_id`, `tenant_id`, `md_columns_name`, `md_columns_type`, `md_columns_length`, `md_dec_length`, `is_cols_null`, `md_columns_desc`, `is_key`, `public_flag`, `active_flag`, `md_tables_id`, `create_by`, `create_date`, `last_update_by`, `last_update_date`) VALUES ('1398550847767076871', '3', 'LINE_CATEGORY_CODE', 'CHAR', '10', NULL, 'Y', '1.按业务分正向行、退货行(负向行)、调整行三类。\r\n使用固定值：\r\n1 NORMAL \r\n4  RETURN \r\n5  ADJUST\r\n对应原SO行字段LINE_CATEGORY_CODE。\r\n2.赋值逻辑\r\n新的交付配置行生成履行行时，赋值1。\r\n正向履行行触发后，原有交付配置行减配生成负向履行行时，赋值4。\r\nRAS/TMS调整单生成的履行行赋值5。\r\n', 'N', 'Y', 'Y', '1398550847511224320', '1004', '2021-05-29 16:04:40', '1004', '2021-05-29 16:04:40');
INSERT INTO `md_columns` (`md_columns_id`, `tenant_id`, `md_columns_name`, `md_columns_type`, `md_columns_length`, `md_dec_length`, `is_cols_null`, `md_columns_desc`, `is_key`, `public_flag`, `active_flag`, `md_tables_id`, `create_by`, `create_date`, `last_update_by`, `last_update_date`) VALUES ('1398550847767076872', '3', 'LINE_TYPE_CODE', 'CHAR', '10', NULL, 'Y', '1.行类型编码与收入中心的核算业务类型存在对应关系。\r\n使用lookup定义行类型编码与名称，如行类型编码110 的名称是 Service Fulfill Line。\r\n存储编码，UI功能中显示行类型名称。\r\n对应原SO行字段LINE_TYPE_ID。\r\n2.赋值逻辑\r\n行类型编码是行分类编码与合同财务核算分类编码的组合。', 'N', 'Y', 'Y', '1398550847511224320', '1004', '2021-05-29 16:04:40', '1004', '2021-05-29 16:04:40');
